[{"location":"index.html#StomtaModels.jl","page":"Home","title":"StomtaModels.jl","text":"","category":"section"},{"location":"index.html#Use-StomataModels","page":"Home","title":"Use StomataModels","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"julia> using Photosynthesis\njulia> using StomataModels\njulia> envir  = AirLayer{FT}();\njulia> ps_3   = C3CLM(FT);\njulia> leaves = Leaves{FT}(n_leaf=2);\njulia> sm     = OSMWang{FT}();\njulia> \njulia> leaf_photo_from_envir!(ps_3, leaves, envir, sm);","category":"page"},{"location":"API.html#StomtaModels-API","page":"API","title":"StomtaModels API","text":"","category":"section"},{"location":"API.html","page":"API","title":"API","text":"CurrentModule = StomataModels","category":"page"},{"location":"API.html#Stomatal-model-schemes","page":"API","title":"Stomatal model schemes","text":"","category":"section"},{"location":"API.html","page":"API","title":"API","text":"AbstractStomatalModel\nEmpiricalStomatalModel\nESMBallBerry\nESMGentine\nESMLeuning\nESMMedlyn\nOptimizationStomatalModel\nOSMEller\nOSMSperry\nOSMWang\nOSMWAP\nOSMWAPMod","category":"page"},{"location":"API.html#StomataModels.AbstractStomatalModel","page":"API","title":"StomataModels.AbstractStomatalModel","text":"type AbstractStomatalModel\n\nHierarchy of the AbstractStomatalModel:\n\nEmpiricalStomatalModel\nOptimizationStomatalModel\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.EmpiricalStomatalModel","page":"API","title":"StomataModels.EmpiricalStomatalModel","text":"type EmpiricalStomatalModel\n\nHierarchy of the EmpiricalStomatalModel:\n\nESMBallBerry\nESMGentine\nESMLeuning\nESMMedlyn\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.ESMBallBerry","page":"API","title":"StomataModels.ESMBallBerry","text":"struct ESMBallBerry{FT}\n\nAn empirical model parameter set type for Ball-Berry type model. The equation used for Ball-Berry type model is\n\ngs = g0 + g1  RH  dfracACs\n\nFields\n\ng0\nminimal stomatal conductance g0 [mol m⁻² s⁻¹]\ng1\nslope of conductance-photosynthesis correlation [unitless]\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.ESMGentine","page":"API","title":"StomataModels.ESMGentine","text":"struct ESMGentine{FT}\n\nAn empirical model parameter set type for Gentine type model. The equation used for Gentine type model is\n\ngs = g0 + g1  dfrack_leafk_max  dfracACa\n\nNote it that the Gentine model does not require for a β function to tune the     soil drought response, but the use of k_leaf also does not permit     post-drought stomatal response unless k_leaf can be recovered.\n\nFields\n\ng0\nminimal stomatal conductance g0 [mol m⁻² s⁻¹]\ng1\nslope of conductance-photosynthesis correlation [unitless]\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.ESMLeuning","page":"API","title":"StomataModels.ESMLeuning","text":"struct ESMLeuning{FT}\n\nAn empirical model parameter set type for Leuning type model. The equation used for Leuning type model is\n\ngs = g0 + g1  dfracACs - Γ^*  dfrac11 + dfracVPDd0\n\nFields\n\ng0\nminimal stomatal conductance g0 [mol m⁻² s⁻¹]\ng1\nslope of conductance-photosynthesis correlation [unitless]\nd0\nfitting parameter of d/d0 below the fraction, same unit as vpd [Pa]\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.ESMMedlyn","page":"API","title":"StomataModels.ESMMedlyn","text":"struct ESMMedlyn{FT}\n\nAn empirical model parameter set type for Medlyn type model. The equation used in Medlyn type model is\n\ngs = g0 + (1 + \\dfrac{g1}{\\sqrt{VPD}} ⋅ \\dfrac{A}{Ca}\n\nFields\n\ng0\nminimal stomatal conductance g0 [mol m⁻² s⁻¹]\ng1\nslope of conductance-photosynthesis correlation [Pa⁽⁵⁾]\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.OptimizationStomatalModel","page":"API","title":"StomataModels.OptimizationStomatalModel","text":"type OptimizationStomatalModel\n\nHierarchy of the OptimizationStomatalModel:\n\nOSMEller\nOSMSperry\nOSMWang\nOSMWAP\nOSMWAPMod\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.OSMEller","page":"API","title":"StomataModels.OSMEller","text":"struct OSMEller\n\nAn optimization model parameter set type for Eller model. The equation used for Eller model is\n\ndfracΘE = -dfracKE  dfracAK\n\nwhere K is dfracEP.\n\nFields\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.OSMSperry","page":"API","title":"StomataModels.OSMSperry","text":"struct OSMSperry\n\nAn optimization model parameter set type for Sperry model. The equation used for Sperry model is\n\ndfracΘE = -dfracKE  dfracA_maxK_max\n\nwhere K is dfracEP.\n\nFields\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.OSMWang","page":"API","title":"StomataModels.OSMWang","text":"struct OSMWang\n\nAn optimization model parameter set type for Eller type model. The equation used for Wang model is\n\ndfracΘE = dfracAE_crit - E\n\nFields\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.OSMWAP","page":"API","title":"StomataModels.OSMWAP","text":"struct OSMWAP{FT}\n\nAn optimization model parameter set type for Wolf-Anderegg-Pacala type model. The equation used for Wolf-Anderegg-Pacala model is\n\ndfracΘE = dfrac2aP + bK\n\nwhere K is ∂P/∂E.\n\nFields\n\na\nQuadratic equation parameter [μmol m⁻² s⁻¹ MPa⁻²]\nb\nQuadratic equation parameter [μmol m⁻² s⁻¹ MPa⁻¹]\n\n\n\n\n\n","category":"type"},{"location":"API.html#StomataModels.OSMWAPMod","page":"API","title":"StomataModels.OSMWAPMod","text":"struct OSMWAPMod{FT}\n\nAn optimization model parameter set type for Wolf-Anderegg-Pacala type model,     modified by adding a photosynthesis component while set b and c = 0. The equation used for modified Wolf-Anderegg-Pacala model is\n\ndfracΘE = dfracaAPK\n\nwhere P is absolute value of leaf xylem pressure.\n\nFields\n\na\nQuadratic equation parameter [mol mol⁻¹ MPa⁻¹]\n\n\n\n\n\n","category":"type"},{"location":"API.html#Leaves","page":"API","title":"Leaves","text":"","category":"section"},{"location":"API.html","page":"API","title":"API","text":"Leaves","category":"page"},{"location":"API.html#StomataModels.Leaves","page":"API","title":"StomataModels.Leaves","text":"struct Leaves{FT}\n\nStruct to store leaf information (multi-dimensional).\n\nFields\n\nhs\nLeaf hydraulic system\nps\nleaf photosynthesis system\nn_leaf\nH\nSensible Heat Flux [W m⁻²]\nLE\nLatent Heat Flux [W m⁻²]\nRn\nNet Radiation Balance [W m⁻²]\nLV\nLatent Heat of evaporation [J mol⁻¹]\nT\nTemperature [K]\nT_old\nOld temperature [K]\nwidth\nLeaf width [m]\nKn\nNPQ rate constant (initially zero)\nKp\nRate constant for photochemistry (all reaction centers open)\nKd\nRate constant for thermal dissipation\nKf\nRate constant for fluorescence (const)\nKpmax\nMaximal rate constant for photochemistry (all reaction centers open)\nmaxPSII\nmax PSII yield (Kn=0, all RC open)\nPSII_frac\nFraction of absorbed light used by PSII ETR\ng_bc\nBoundary layer conductance to CO₂ [mol m⁻² s⁻¹]\ng_bh\nBoundary layer conductance to heat [mol m⁻² s⁻¹]\ng_bw\nBoundary layer conductance to H₂O [mol m⁻² s⁻¹]\ng_lc\nLeaf diffusive conductance to water CO₂ [mol m⁻² s⁻¹]\ng_lw\nLeaf diffusive conductance to water H₂O [mol m⁻² s⁻¹]\ng_m\nMesophyll conductance for CO₂ [mol m⁻² s⁻¹]\ng_sc\nStomatal conductance to water CO₂ [mol m⁻² s⁻¹]\ng_sw\nStomatal conductance to water H₂O [mol m⁻² s⁻¹]\ng_ias_c\nGias correction constant\ng_ias_e\nGias correction exponent\ng_max\nMaximal leaf diffusive conductance [mol m⁻² s⁻¹]\ng_max25\nMaximal leaf diffusive conductance at 298.15 K [mol m⁻² s⁻¹]\ng_min\nMinimal leaf diffusive conductance [mol m⁻² s⁻¹]\ng_min25\nMinimal leaf diffusive conductance at 298.15 K [mol m⁻² s⁻¹]\np_i\nLeaf internal CO₂ partial pressure [Pa]\np_s\nLeaf surface CO₂ partial pressure [Pa]\np_sat\nLeaf saturation vapor pressure [Pa]\nAc\nRubisCO limited photosynthetic rate [μmol m⁻² s⁻¹]\nAj\nLight limited photosynthetic rate [μmol m⁻² s⁻¹]\nAg\nGross photosynthetic rate [μmol m⁻² s⁻¹]\nAn\nNet photosynthetic rate [μmol m⁻² s⁻¹]\nAp\nProduct limited photosynthetic rate [μmol m⁻² s⁻¹]\nJ\nElectron transport [μmol m⁻² s⁻¹]\nJ_pot\nPotential Electron Transport Rate [μmol m⁻² s⁻¹]\nJmax\nMaximal electron transport rate [μmol m⁻² s⁻¹]\nJmax25\nMaximal electron transport rate at 298.15 K [μmol m⁻² s⁻¹]\nKc\nRubisCO coefficient Kc [Pa]\nKo\nRubisCO coefficient Ko [Pa]\nKpep\nPEP coefficient Ko [Pa]\nKm\nMichaelis-Menten's coefficient [Pa]\nRd\nRespiration rate [μmol m⁻² s⁻¹]\nRd25\nRespiration rate at 298.15 K [μmol m⁻² s⁻¹]\nVcmax\nMaximal carboxylation rate [μmol m⁻² s⁻¹]\nVcmax25\nMaximal carboxylation rate at 298.15 K [μmol m⁻² s⁻¹]\nVpmax\nMaximal PEP carboxylation rate [μmol m⁻² s⁻¹]\nVpmax25\nMaximal PEP carboxylation rate at 298.15 K [μmol m⁻² s⁻¹]\nΓ_star\nCO₂ compensation point with the absence of Rd [Pa]\nCO₂_per_electron\nTotal efficiency, incl. photorespiration [mol CO₂ mol⁻¹ e-]\nFm′\nlight adapted yield (Kp=0)\nFo′\nlight-adapted fluorescence yield in the dark (Kp=max)\nJa\nActual electron transport rate [μmol m⁻² s⁻¹]\nNPQ\nNon-Photochemical quenching\nqQ\nPhotochemical quenching\nqE\nenergy quenching\nφ\nPSII yield\nϕs\nSteady-state (light-adapted) yield (aka Fs)\nFm\ndark adapted yield (Kp=0)\nFo\ndark-adapted fluorescence yield (Kp=max)\nAPAR\nAbsorbed photosynthetic active radiation [μmol m⁻² s⁻¹]\na_max\nMaximal photosynthetic rate [μmol m⁻² s⁻¹]\ne\nFlow rate [mol m⁻² s⁻¹]\nec\nCritical flow rate [mol m⁻² s⁻¹]\nkr_max\nMaximal hydraulic conductance ratio\np_ups\nBase xylem pressre [MPa]\np_old\nBase xylem pressre memory [MPa]\n\n\n\n\n\n","category":"type"},{"location":"API.html#Stomatal-conductance","page":"API","title":"Stomatal conductance","text":"","category":"section"},{"location":"API.html","page":"API","title":"API","text":"empirical_gsw_from_model\nenvir_diff!\nleaf_photo_from_envir!","category":"page"},{"location":"API.html#StomataModels.empirical_gsw_from_model","page":"API","title":"StomataModels.empirical_gsw_from_model","text":"empirical_gsw_from_model(\n        model::EmpiricalStomatalModel,\n        leaf::Leaf{FT},\n        envir::AirLayer{FT},\n        β::FT)\nempirical_gsw_from_model(\n        model::EmpiricalStomatalModel,\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        β::FT)\nempirical_gsw_from_model(\n        model::EmpiricalStomatalModel,\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        β::FT,\n        ind::Int)\n\nSteady state gsw from empirical approach given\n\nmodel EmpiricalStomatalModel type empirical model parameter set\nleaf [Leaf] type struct\nleaves Leaves type struct\nenvir [AirLayer] type struct\nβ Correction factor over the g1 part of an empirical model\nind Nth leaf in Leaves\n\n\n\n\n\n","category":"function"},{"location":"API.html#StomataModels.envir_diff!","page":"API","title":"StomataModels.envir_diff!","text":"envir_diff!(\n        x::FT,\n        photo_set::AbstractPhotoModelParaSet,\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        sm::AbstractStomatalModel,\n        ind::Int)\n\nCalculate the difference to be minimized for a given\n\nx Assumed leaf diffusive conductance\nphoto_set[C3ParaSet] or [C4ParaSet] type parameter set\nleavesLeaves type struct\nenvir[AirLayer] type struct\nsm Stomatal model option (photo_set.Sto)\nint Nth leaf in Leaves\n\n\n\n\n\n","category":"function"},{"location":"API.html#StomataModels.leaf_photo_from_envir!","page":"API","title":"StomataModels.leaf_photo_from_envir!","text":"leaf_photo_from_envir!(\n        photo_set::AbstractPhotoModelParaSet,\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        sm::AbstractStomatalModel)\nleaf_photo_from_envir!(\n        photo_set::AbstractPhotoModelParaSet,\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        sm::AbstractStomatalModel,\n        ind::Int)\n\nCalculate steady state gsw and photosynthesis from empirical approach, given\n\nphoto_set [C3ParaSet] or [C4ParaSet] type parameter set\nleaves Leaves type struct\nenvir [AirLayer] type struct\nsm EmpiricalStomatalModel or OptimizationStomatalModel\nind Nth leaf in leaves\n\n\n\n\n\n","category":"function"},{"location":"API.html#Photosynthesis","page":"API","title":"Photosynthesis","text":"","category":"section"},{"location":"API.html","page":"API","title":"API","text":"update_leaf_TP!\nupdate_leaf_AK!\nupdate_leaf_from_glc!\nupdate_leaf_from_gsw!\nleaf_gsw_control!","category":"page"},{"location":"API.html#StomataModels.update_leaf_TP!","page":"API","title":"StomataModels.update_leaf_TP!","text":"update_leaf!(\n        photo_set::AbstractPhotoModelParaSet{FT},\n        leaves::Leaves{FT},\n        envir::AirLayer{FT})\n\nUpdate leaf physiological parameters if temperature or pressure changes in the daytime, given\n\nphoto_set [C3ParaSet] or [C4ParaSet] type parameter set\nleaves Leaves type struct\nenvir [AirLayer] type struct\n\n\n\n\n\n","category":"function"},{"location":"API.html#StomataModels.update_leaf_AK!","page":"API","title":"StomataModels.update_leaf_AK!","text":"update_leaf_AK!(\n        photo_set::AbstractPhotoModelParaSet{FT},\n        leaves::Leaves{FT},\n        envir::AirLayer{FT})\n\nUpdate leaf maximal A and K for Sperry model, given\n\nphoto_set [C3ParaSet] or [C4ParaSet] type parameter set\nleaves Leaves type struct\nenvir [AirLayer] type struct\n\n\n\n\n\n","category":"function"},{"location":"API.html#StomataModels.update_leaf_from_glc!","page":"API","title":"StomataModels.update_leaf_from_glc!","text":"update_leaf_from_glc!(\n        photo_set::AbstractPhotoModelParaSet{FT},\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        ind::Int,\n        glc::FT)\n\nUpdate Nth leaf photosynthesis, given\n\nphoto_set [C3ParaSet] or [C4ParaSet] type parameter set\nleaves Leaves type struct\nenvir [AirLayer] type struct\nind Nth leaf\nglc Given leaf diffusive conductance\n\n\n\n\n\n","category":"function"},{"location":"API.html#StomataModels.update_leaf_from_gsw!","page":"API","title":"StomataModels.update_leaf_from_gsw!","text":"update_leaf_from_gsw!(\n        photo_set::AbstractPhotoModelParaSet{FT},\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        ind::Int,\n        glc::FT)\n\nUpdate Nth leaf photosynthesis, given\n\nphoto_set [C3ParaSet] or [C4ParaSet] type parameter set\nleaves Leaves type struct\nenvir [AirLayer] type struct\nind Nth leaf\ngsw Given stomatal conductance to H₂O\n\n\n\n\n\n","category":"function"},{"location":"API.html#StomataModels.leaf_gsw_control!","page":"API","title":"StomataModels.leaf_gsw_control!","text":"leaf_gsw_control!(\n        photo_set::AbstractPhotoModelParaSet,\n        leaves::Leaves{FT},\n        envir::AirLayer{FT},\n        ind::Int)\n\nmake sure g_sw is in its physiological range limited by diffusion, given\n\nphoto_set [C3ParaSet] or [C4ParaSet] type parameter set\nleaves Leaves type struct\nenvir [AirLayer] type struct\n\n\n\n\n\n","category":"function"}]
